import React from "react";
import ReactDOM from "react-dom";
import "./App.css";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import HomeScreen from "./screens/HomeScreen";
import RoomScreen from "./screens/RoomScreen";
import ContactScreen from "./screens/ContactScreen";
import NearAroundScreen from "./screens/NearAroundScreen";
import PhotoGalleryScreen from "./Screen/PhotoGalleryScreen";
import LocationScreen from "./screens/LocationScreen";


const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/home" component={HomeScreen} />
        <Route path="/rooms" component={RoomScreen} />
        <Route path="/near-around" component={NearAroundScreen} />
        <Route path="/contact-us" component={ContactScreen} />
        <Route path="/near-around-screen" component={NearAroundScreen} />
        <Route path="/photo-gallery-screen" component={PhotoGalleryScreen} />
      </Switch>
    </BrowserRouter>
  );
};

ReactDOM.render(<App />, document.getElementById("root"));
